import React from 'react';
import {
    Box,
    Typography,
    List,
    ListItem,
    ListItemText,
    ListItemButton,
    Divider,
    Paper,
    IconButton,
    Tooltip
} from '@mui/material';
import { styled } from '@mui/material/styles';
import DeleteIcon from '@mui/icons-material/Delete';
import ResultsTable from './ResultsTable';

const StyledListItem = styled(ListItemButton)(({ theme, selected }) => ({
    borderRadius: '8px',
    marginBottom: theme.spacing(1),
    backgroundColor: selected ? 
        theme.palette.mode === 'dark' ? 'rgba(255, 255, 255, 0.08)' : 'rgba(0, 0, 0, 0.04)' 
        : 'transparent',
    '&:hover': {
        backgroundColor: theme.palette.mode === 'dark' 
            ? 'rgba(255, 255, 255, 0.12)' 
            : 'rgba(0, 0, 0, 0.08)'
    }
}));

const SearchHistoryPage = ({ 
    history, 
    onDeleteSearch, 
    results,
    onViewResults,
    loadingExplanations,
    expandedExplanations,
    onGenerateExplanation,
    setExpandedExplanations 
}) => {
    return (
        <Box sx={{ display: 'flex', gap: 3, p: 3 }}>
            {/* Venstre sidebar med søkehistorikk */}
            <Paper sx={{ 
                width: 300, 
                p: 2,
                height: 'fit-content',
                position: 'sticky',
                top: '88px' // Juster denne verdien basert på header-høyden
            }}>
                <Typography variant="h6" gutterBottom>
                    Siste søk
                </Typography>
                <List sx={{ width: '100%' }}>
                    {history.map((item) => (
                        <React.Fragment key={item.id}>
                            <StyledListItem
                                onClick={() => onViewResults(item)}
                                selected={results?.id === item.id}
                            >
                                <Box sx={{ width: '100%' }}>
                                    <Box sx={{ 
                                        display: 'flex', 
                                        justifyContent: 'space-between',
                                        alignItems: 'flex-start'
                                    }}>
                                        <ListItemText
                                            primary={item.course_name}
                                            secondary={new Date(item.created_at).toLocaleString('nb-NO')}
                                            primaryTypographyProps={{
                                                variant: 'subtitle2',
                                                fontWeight: 600
                                            }}
                                            secondaryTypographyProps={{
                                                variant: 'caption'
                                            }}
                                        />
                                        <Tooltip title="Slett søk">
                                            <IconButton 
                                                size="small"
                                                onClick={(e) => {
                                                    e.stopPropagation();
                                                    onDeleteSearch(item.id);
                                                }}
                                            >
                                                <DeleteIcon fontSize="small" />
                                            </IconButton>
                                        </Tooltip>
                                    </Box>
                                    <Typography 
                                        variant="caption" 
                                        color="text.secondary"
                                        sx={{ display: 'block', mt: 0.5 }}
                                    >
                                        {item.results?.length || 0} resultater funnet
                                    </Typography>
                                </Box>
                            </StyledListItem>
                            <Divider sx={{ my: 1 }} />
                        </React.Fragment>
                    ))}
                </List>
            </Paper>

            {/* Høyre side med resultattabell */}
            <Box sx={{ flex: 1 }}>
                {results ? (
                    <>
                        <Typography variant="h6" gutterBottom>
                            Resultater for "{results.course_name}"
                        </Typography>
                        <ResultsTable
                            results={results.results}
                            loadingExplanations={loadingExplanations}
                            expandedExplanations={expandedExplanations}
                            onGenerateExplanation={onGenerateExplanation}
                            setExpandedExplanations={setExpandedExplanations}
                            courseDescription={results.course_description}
                        />
                    </>
                ) : (
                    <Box 
                        sx={{ 
                            display: 'flex', 
                            justifyContent: 'center', 
                            alignItems: 'center',
                            height: '200px',
                            bgcolor: 'background.paper',
                            borderRadius: 1,
                            border: '1px dashed',
                            borderColor: 'divider'
                        }}
                    >
                        <Typography color="text.secondary">
                            Velg et søk fra listen til venstre for å se resultater
                        </Typography>
                    </Box>
                )}
            </Box>
        </Box>
    );
};

export default SearchHistoryPage;
